import java.util.Scanner;public class _2dto1d {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        int n = sc.nextInt();        int m = sc.nextInt();        int[][] arr2d = new int[n][m];        int[] arr = new int[n*m];        int k = 0;        for (int i = 0; i < n; i++) {            for (int j = 0; j < m; j++) {                arr2d[i][j] = sc.nextInt();            }        }        for (int i = 0; i < n; i++) {            for (int j = 0; j < m; j++) {                arr2d[i][j] = arr[k++];            }        }        for (int i = 0; i < arr.length; i++) {            System.out.print(arr[i] + " ");        }    }}